import React from "react";

import Header from "./Header";
import Sidebar from "./Sidebar";

function Home() {
  return (
    <div className="flex">
      {/* HEADER */}
      <Header />

      {/* SIDE BAR */}
      <Sidebar />
    </div>
  );
}

export default Home;
